import React from "react";
import ChatBotify from "react-chatbotify";

function ChatBotWidget() {
  return (
    <ChatBotify
      settings={{
        theme: {
          color: "#4e8cff",
        },
        startMessages: [
          {
            type: "text",
            content: "¡Hola! ¿En qué puedo ayudarte hoy?",
          },
        ],
      }}
    />
  );
}

export default ChatBotWidget;
